import Link from "next/link";

const headerStyle = {
  marginTop: "2vmin",
  marginBottom: "6vmin"
}

const linkStyle = {
  marginRight: 15
}

const Header = () => (
  <header style={headerStyle}>
    <nav className="navbar navbar-expand navbar-light">
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/movie">
        <a style={linkStyle}>Movies</a>
      </Link>
    </nav>
  </header>
);

export default Header;
